import {NavLink} from 'react-router-dom';

export default function Navbar () {
    return ( 
        <nav>
            <div className="nav-center">
                <span className="logo">Thrifty</span>
                <div classname="nav-links">
                    <NavLink to ='/' className='nav-link'>Home
                    </NavLink>
                </div>
            </div>
        </nav>
    );
};
